//     padding: 0,
//     '&:hover': {
//       backgroundColor: 'transparent',
//     },
//   },
//   tabs: {
//     marginLeft: 'auto',
//     '& .MuiButtonBase-root.MuiTab-root': {
//       fontSize: 20,
//     },
//     '& .Mui-selected': {
//       backgroundColor: '#fce0a2',
//       color: '#000',
//       opacity: 0.7,
//       borderRadius: 2,
//     },
//   },
